    salinity and other variables collected from Surface underway observations using
    Barometric pressure sensor, Carbon dioxide (CO2) gas analyzer and other instruments
    from Trans Future 5 in the Bass Strait, Coral Sea and others from 2012-01-16 to
    2012-12-07 (NCEI Accession 0144347)",nt"tracking_summary": {ntt"total":
    3,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-03-07T18:33:58.481541",nt"name": "partial-pressure-or-fugacity-of-carbon-dioxide-salinity-and-other-variables-collected-from-surf7f318",nt"isopen":
    false,nt"url": null,nt"notes": "NCEI Accession 0144347 includes Surface
    underway data collected from Trans Future 5 in the Bass Strait, Coral Sea, East
    China Sea (Tung Hai), Inland Sea (Seto Naikai), North Pacific Ocean, Philippine
    Sea, Solomon Sea, South China Sea (Nan Hai), South Pacific Ocean and Tasman Sea
    from 2012-01-16 to 2012-12-07. These data include ABSOLUTE HUMIDITY, AIR TEMPERATURE,
    AIR-SEA DIFFERENCE - PARTIAL PRESSURE (OR FUGACITY) OF CARBON DIOXIDE, BAROMETRIC
    PRESSURE, INCOMING SOLAR RADIATION, Partial pressure (or fugacity) of carbon dioxide
    - atmosphere, Partial pressure (or fugacity) of carbon dioxide - water, RELATIVE
    HUMIDITY, SALINITY, SEA SURFACE TEMPERATURE and WIND SPEED. The instruments used
    to collect these data include Barometric pressure sensor, Carbon dioxide (CO2) gas
    analyzer, Shower head chamber equilibrator for autonomous carbon dioxide (CO2) measurement
    and thermosalinographs.nnThese data were collected by Yukihiro Nojiri of National
    Institute for Environmental Studies as part of the VOS_Trans_Future_5_2012 data
    set. CDIAC associated the following cruise ID(s) with this data set: PAT520120116nnThe
    Global Volunteer Observing Ship (VOS) Program is coordinated by the UNESCO International
    Ocean Carbon Coordination Project (IOCCP). International groups from 14 countries
    have been outfitting research ships and commercial vessels with automated CO2 sampling
    equipment to analyze the carbon exchange between the ocean and atmosphere.",nt"license_title":
